// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract FoodWaste is Ownable {
    // Struct to hold food donation details
    struct Donation {
        uint id;
        address donor;
        string description;
        uint quantity;
        bool isClaimed;
    }

    // Struct to hold recipient requests
    struct Request {
        uint donationId;
        address recipient;
        bool isApproved;
    }

    // State variables
    uint public donationCounter;
    mapping(uint => Donation) public donations;
    mapping(uint => Request) public requests;

    // Events
    event DonationAdded(uint id, address indexed donor, string description, uint quantity);
    event RequestMade(uint donationId, address indexed recipient);
    event DonationClaimed(uint donationId, address indexed recipient);

    // Constructor
    constructor(address initialOwner) Ownable(initialOwner) {}

    // Function to add a new food donation
    function addDonation(string memory _description, uint _quantity) public {
        require(_quantity > 0, "Quantity must be greater than zero");
        donationCounter++;
        donations[donationCounter] = Donation(donationCounter, msg.sender, _description, _quantity, false);

        emit DonationAdded(donationCounter, msg.sender, _description, _quantity);
    }

    // Function to request a donation
    function requestDonation(uint _donationId) public {
        require(donations[_donationId].donor != address(0), "Donation does not exist");
        require(!donations[_donationId].isClaimed, "Donation already claimed");

        requests[_donationId] = Request(_donationId, msg.sender, false);

        emit RequestMade(_donationId, msg.sender);
    }

    // Function to approve a donation request
    function approveRequest(uint _donationId) public onlyOwner {
        require(requests[_donationId].recipient != address(0), "Request does not exist");
        require(!donations[_donationId].isClaimed, "Donation already claimed");

        donations[_donationId].isClaimed = true;
        requests[_donationId].isApproved = true;

        emit DonationClaimed(_donationId, requests[_donationId].recipient);
    }
}
